import React, { useState, useEffect } from 'react';
import { Router, Route, Link, BrowserRouter, IndexRoute } from 'react-router-dom';
import CarDesc from './carDesc';
import './style.css'

const SelectCar = () => {
  const [brand, setBrand] = useState([]);
  useEffect(() => {

    fetch(
      `http://uimocks.infoedge.com/makes.json`,
      {
        method: "GET",
      },
    )
      .then(res => res.json())
      .then(response => {
        setBrand(response);
      })
      .catch(error => console.log(error));
  });

  return (
    <React.Fragment>
      <select>
        {brand.map((brand, index) => (

            <option
              key={index}
              value={index}
            >
             {brand}
            </option>


        ))}

      </select>
      <button> <Link to="/model">next</Link> </button>
      <div>
      <Route path='/model' component={CarDesc} />
      {/* <Route path='/profile' component={Profile} /> */}
    </div>
    </React.Fragment>
  )
}

export default SelectCar;
